●メーカー名：アイリスオーヤマ(株)　●カラー：ブラック　●サイズ/仕様：232x274x201mm ●商品サイズ(約）：幅232x奥行274x高さ201ｍｍ。●商品重量(約）：2750g。●製品仕様/電源：AC100V(50/60Hz共用)、消費電力：450W、炊飯容量(最大)：無洗米/白米0.54L(2合)・炊込み0.36L(2合)・おかゆ/全がゆ0.18L/5分がゆ0.09L(0.5合)・玄米0.36L(2合)、区分名：E、蒸発水量：21.4ｇ、年間消費電力：36.8KWｈ/年、1回あたりの炊飯時消費電力量：89.6Wh、1時間あたりの保温時消費電力量：10.4Wh、1時間あたりのタイマー予約時消費電力量：0.35Wh、1時間あたりの待機時消費電力量：0.33Wh、コードの長さ：約1.0m。 いつものごはんをさらに美味しく炊き上げる、米屋の旨み銘柄炊きジャー炊飯器です。主要な31銘柄を最適な火力と時間で、旨さを引き出し炊き上げます。極厚火釜で熱を逃がさず包み込み、お米の芯まで熱を伝えふっくらと炊き上げます。炊飯メニューが6メニュー(無洗米、白米、炊き込み、おかゆ、玄米、煮込/蒸し）とモードが炊き分け銘柄、省エネ、早炊きがあります。タイマーを使って炊き上がり時刻を予約することができます。 ●31銘柄炊き。●厚さ3.1mm極厚火釜使用。●炊き上がりをタイマー予約できます。●保証期間：お買い上げ日より1年間。

